        public async Task<IActionResult> Index()
        {
            //await test();
            

            IConfiguration config = new ConfigurationBuilder().AddJsonFile("appsettings.json", true, true).Build();

            var rpcConnnectionSettings = new RpcConnectionSetting();

            config.GetSection("OdooConnection").Bind(rpcConnnectionSettings);

            //Connection
            var conn = new RpcConnection(rpcConnnectionSettings);

            await serviceInit.hrDepartmentService.GetHrDepartments(conn);
            //await ServiceHrDepartment.GetHrDepartment(conn);

            return View();
        }
        public IActionResult Privacy()
        {
            return View();
        }
        [ResponseCache(Duration = 0, Location = ResponseCacheLocation.None, NoStore = true)]
        public IActionResult Error()
        {
            return View(new ErrorViewModel { RequestId = Activity.Current?.Id ?? HttpContext.TraceIdentifier });
        }
        public static object CreateEmptyObject(string className, Assembly assembly)
        {
            Type type = assembly.GetType(className);
            if (type == null)
